ADDITIONAL INFO-Sophie is a beautiful tricolor dog that looks more like a puppy, but she's approximately 2 years old. Sophie was very underweight when Lost Paws of Texas rescued her so she gets very excited when it's feeding time or when you give her treats and she can nip your fingers. Once she realizes that her food will come on a regular basis and you give her a gentle correction this should be able to be resolved fairly quickly. She gets along well with other dogs so she could be a great canine sibling as well as an only family pet.
